import React from 'react';


const getMealData=()=>{
    fetch(
        'https://api.spoonacular.com/recipes/findByNutrients?minCarbs=10&maxCarbs=50&number=2&apiKey=a9b075e6656c45f587b86cba1c8c3789'
      )
        .then((response) => response.json())
        .then((data) => {
          console.log(data[0].title);
        })
        .catch(() => {
          console.log("error");
        });
}

const Meal=props=>{

    return (
        <div>
            {getMealData}
        </div>

    )

}
export default Meal;
